{
   "version": "7.2",
    "data_api_version": "3.0",
        "routing_model": {
        "PRODUCT_SELECTOR": [
            "OPTIONS"
        ],
        "OPTIONS": [
            "OFFER"
        ],
        "OFFER": [
            "PRODUCT_DETAIL"
        ]
    },
    "screens": [
        {
            "id": "PRODUCT_SELECTOR",
            "title": "Black Friday Deals",
            "data": {
                "products": {
                    "type": "array",
                    "items": {
                        "type": "object",
                        "properties": {
                            "id": {
                                "type": "string"
                            },
                            "title": {
                                "type": "string"
                            }
                        }
                    },
                    "__example__": [
                        {
                            "id": "0_mobile_phones",
                            "title": "Mobile phones"
                        },
                        {
                            "id": "1_eBook_readers",
                            "title": "eBook readers"
                        },
                        {
                            "id": "2_cameras",
                            "title": "Cameras"
                        }
                    ]
                }
            },
            "layout": {
                "type": "SingleColumnLayout",
                "children": [
                    {
                        "type": "Form",
                        "name": "selector_form",
                        "children": [
                            {
                                "type": "RadioButtonsGroup",
                                "label": "What would you like to buy now",
                                "name": "product_selection",
                                "data-source": "${data.products}",
                                "required": true
                            },
                            {
                                "type": "Footer",
                                "label": "Continue",
                                "on-click-action": {
                                    "name": "data_exchange",
                                    "payload": {
                                        "product_selection": "${form.product_selection}"
                                    }
                                }
                            }
                        ]
                    }
                ]
            }
        },
        {
            "id": "OPTIONS",
            "title": "Black Friday Deals",
            "data": {
                "selected_product": {
                    "type": "string",
                    "__example__": "phone"
                },
                "cta_label": {
                    "type": "string",
                    "__example__": "View phones"
                },
                "screen_heading": {
                    "type": "string",
                    "__example__": "Lets find the perfect phone offer for you"
                },
                "phone_use_case": {
                    "type": "boolean",
                    "__example__": false
                },
                "preferred_brands": {
                    "type": "array",
                    "items": {
                        "type": "object",
                        "properties": {
                            "id": {
                                "type": "string"
                            },
                            "title": {
                                "type": "string"
                            }
                        }
                    },
                    "__example__": [
                        {
                            "id": "0_TechWave",
                            "title": "TechWave"
                        },
                        {
                            "id": "1_Apex",
                            "title": "Apex"
                        }
                    ]
                },
                "phone_uses": {
                    "type": "array",
                    "items": {
                        "type": "object",
                        "properties": {
                            "id": {
                                "type": "string"
                            },
                            "title": {
                                "type": "string"
                            }
                        }
                    },
                    "__example__": [
                        {
                            "id": "0_Social_networking",
                            "title": "Social networking"
                        },
                        {
                            "id": "1_Video_streaming",
                            "title": "Video streaming"
                        },
                        {
                            "id": "2_Gaming",
                            "title": "Gaming"
                        },
                        {
                            "id": "3_Productivity",
                            "title": "Productivity"
                        },
                        {
                            "id": "4_Work_communication",
                            "title": "Work communication"
                        }
                    ]
                },
                "phone_sim": {
                    "type": "array",
                    "items": {
                        "type": "object",
                        "properties": {
                            "id": {
                                "type": "string"
                            },
                            "title": {
                                "type": "string"
                            }
                        }
                    },
                    "__example__": [
                        {
                            "id": "0_eSim",
                            "title": "eSim"
                        },
                        {
                            "id": "1_Standard_sim",
                            "title": "Standard sim"
                        }
                    ]
                },
                "preferred_budget": {
                    "type": "array",
                    "items": {
                        "type": "object",
                        "properties": {
                            "id": {
                                "type": "string"
                            },
                            "title": {
                                "type": "string"
                            }
                        }
                    },
                    "__example__": [
                        {
                            "id": "0_£100_-_£250",
                            "title": "£100 - £250"
                        },
                        {
                            "id": "1_£250_-_£500",
                            "title": "£250 - £500"
                        },
                        {
                            "id": "2_£500_-_£1000",
                            "title": "£500 - £1000"
                        },
                        {
                            "id": "3_Above_£1000",
                            "title": "Above £1000"
                        }
                    ]
                }
            },
            "layout": {
                "type": "SingleColumnLayout",
                "children": [
                    {
                        "type": "Form",
                        "name": "options_form",
                        "children": [
                            {
                                "type": "TextSubheading",
                                "text": "${data.screen_heading}"
                            },
                            {
                                "type": "CheckboxGroup",
                                "label": "Select preferred brands",
                                "required": true,
                                "name": "brands",
                                "data-source": "${data.preferred_brands}"
                            },
                            {
                                "type": "CheckboxGroup",
                                "label": "Purpose of using mobile phone",
                                "required": "${data.phone_use_case}",
                                "name": "phone_uses",
                                "visible": "${data.phone_use_case}",
                                "data-source": "${data.phone_uses}"
                            },
                            {
                                "type": "RadioButtonsGroup",
                                "label": "Select SIM card type",
                                "required": "${data.phone_use_case}",
                                "visible": "${data.phone_use_case}",
                                "name": "phone_sim",
                                "data-source": "${data.phone_sim}"
                            },
                            {
                                "type": "RadioButtonsGroup",
                                "label": "What is your budget?",
                                "required": true,
                                "name": "budget",
                                "data-source": "${data.preferred_budget}"
                            },
                            {
                                "type": "Footer",
                                "label": "${data.cta_label}",
                                "on-click-action": {
                                    "name": "data_exchange",
                                    "payload": {
                                        "brand": "${form.brands}",
                                        "phone_use": "${form.phone_uses}",
                                        "phone_sim": "${form.phone_sim}",
                                        "budget": "${form.budget}",
                                        "selected_product": "${data.selected_product}"
                                    }
                                }
                            }
                        ]
                    }
                ]
            }
        },
        {
            "id": "OFFER",
            "title": "Personalised offers",
            "data": {
                "selected_product": {
                    "type": "string",
                    "__example__": "phone"
                },
                "offer_label": {
                    "type": "string",
                    "__example__": "Here are 4 shortlisted phones"
                },
                "shortlisted_devices": {
                    "type": "array",
                    "items": {
                        "type": "object",
                        "properties": {
                            "id": {
                                "type": "string"
                            },
                            "title": {
                                "type": "string"
                            }
                        }
                    },
                    "__example__": [
                        {
                            "id": "0_TechWave_TW14_Pro",
                            "title": "TechWave TW14 Pro"
                        },
                        {
                            "id": "1_Apex_Aura",
                            "title": "Apex Aura"
                        },
                        {
                            "id": "2_VirtuVision_VX2",
                            "title": "VirtuVision VX2"
                        },
                        {
                            "id": "3_Nova_N1",
                            "title": "Nova N1"
                        }
                    ]
                }
            },
            "layout": {
                "type": "SingleColumnLayout",
                "children": [
                    {
                        "type": "Form",
                        "name": "offer_form",
                        "children": [
                            {
                                "type": "RadioButtonsGroup",
                                "label": "${data.offer_label}",
                                "required": true,
                                "name": "devices",
                                "data-source": "${data.shortlisted_devices}"
                            },
                            {
                                "type": "Footer",
                                "label": "View details",
                                "on-click-action": {
                                    "name": "data_exchange",
                                    "payload": {
                                        "device": "${form.devices}"
                                    }
                                }
                            }
                        ]
                    }
                ]
            }
        },
        {
            "id": "PRODUCT_DETAIL",
            "title": "${data.product_name}",
            "data": {
                "selected_device": {
                    "type": "string",
                    "__example__": "0_TechWave_TW14_Pro"
                },
                "image_src": {
                    "type": "string",
                    "__example__": ""
                },
                "product_name": {
                    "type": "string",
                    "__example__": "TechWave TW14 Pro"
                },
                "product_properties": {
                    "type": "string",
                    "__example__": "£500・6.2 inches・128GB・20 MP"
                },
                "detail_1": {
                    "type": "string",
                    "__example__": "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco."
                },
                "detail_2": {
                    "type": "string",
                    "__example__": "Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum."
                }
            },
            "terminal": true,
            "layout": {
                "type": "SingleColumnLayout",
                "children": [
                    {
                        "type": "Form",
                        "name": "product",
                        "children": [
                            {
                                "type": "Image",
                                "src": "${data.image_src}",
                                "height": 250,
                                "scale-type": "cover"
                            },
                            {
                                "type": "TextHeading",
                                "text": "${data.product_name}"
                            },
                            {
                                "type": "TextCaption",
                                "text": "${data.product_properties}"
                            },
                            {
                                "type": "TextBody",
                                "text": "${data.detail_1}"
                            },
                            {
                                "type": "TextBody",
                                "text": "${data.detail_2}"
                            },
                            {
                                "type": "Footer",
                                "label": "Place order",
                                "on-click-action": {
                                    "name": "complete",
                                    "payload": {
                                        "selected_device": "${data.selected_device}"
                                    }
                                }
                            }
                        ]
                    }
                ]
            }
        }
    ]
      }oon